export function add10(a: number, b: number): number {
  return a + b;
}

export function subtract10(a: number, b: number): number {
  return a - b;
}

export function multiply10(a: number, b: number): number {
  return a * b;
}

export function divide10(a: number, b: number): number {
  return a / b;
}
